import './App.css';
import React, { useState, useEffect } from "react";
import Banner from './components/banner.js';

function App() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8000/products")
      .then((res) => res.json())
      .then((data) => {
        if (data.results) {
          setProducts(data.results);
        } else {
          console.error('Error fetching products:', data);
        }
      })
      .catch((error) => {
        console.error('Error fetching products:', error);
      });
  }, []);

  return (
    <div className="App">
      <Banner/>
      <h1>ðŸ”¥HOT DEALSðŸ”¥</h1>
      <p>
        {products.map((product, index) => (
          <ul id={product.Product_ID} key={product.Product_ID}>
            <h3>{product.Product_Name}</h3>
            <img src={product.Image} alt={product.Product_Name} style={{ width: '100px', height: 'auto' }}/>
            <h4>ON SALE FOR : {product.Discount_Price}</h4>
            {product.Full_Price && product.Full_Price !== '' && ( // Conditional rendering
              <h4>Originally : {product.Full_Price}</h4>
            )}
          </ul> 
        ))}
      </p>

    </div>
  );
}

export default App;
